[
  {
    "type": "paragraph",
    "label": "Paragraph",
    "content": "When we saw the first picture of [the women](http://www.cosmopolitan.com.au/bachelor/the-bachelor-australia-2017-contestants-instagram-23408) on [***The Bachelor Australia***](http://www.cosmopolitan.com.au/lifestyle/the-bachelor-australia-2017-contestants-23070) 2017, we thought, ‘Hmm, there’s something familiar about these ladies.’\n\nNo, it’s not just that there’s a [lack of diversity](http://www.cosmopolitan.com.au/bachelor/asian-bachelorette-parody-video-23493) among them, and that some of them kinda resemble each other — it’s that most of them have [celebrity or pop culture lookalikes](http://www.cosmopolitan.com.au/lifestyle/the-bachelorette-celebrity-lookalikes-12075).\n\nSo when [**Matty J**](http://www.cosmopolitan.com.au/bachelor/matty-j-the-bachelor-australia-fun-facts-23333) gives his final rose to one lucky lady, he may be choosing to spend the rest of his life with one of these stars…"
  }
]
